import React, { Component } from 'react';
import styles from './Table.module.css';
import TableRow from '../TableRow/TableRow';

class Table extends Component{
    render(){
        return(
            <div>
                <h1>Table</h1>
                <TableRow isHead={true}/>
                <TableRow isHead={false} codeName="Firework" description='Make some cool' date='22.04.2023'/>
                <TableRow isHead={false} codeName="Pokemon" description='Meet with Pikachy' date='12.11.2021'/>
            </div>
        )
    }
}

export default Table;
